<!doctype html>
<html>

    </head>
    <body>
    <h3>CSV-Ws generated are as below. The latest commit id is a1fb6a9ba6e391a60fd34854fd6a5c79c5bb2e35.</h3>
    <div id="files-container"></div>
    <script type="text/javascript">
        var html_str = "<ul>";
        var files = "|||".split('|||');
        files.shift()
        files.sort()
        files.forEach(function(file) {
        file = file.replace("./","")
        link = "https://nimshi89.github.io/csv-to-csvw-test/"+file
        html_str += "<li>"+"<a href='"+ link + "'>"+file+"</a></li>";
        });
        html_str += "</ul>";
        document.getElementById("files-container").innerHTML = html_str;
    </script>
    </body>
</html>
